import React from "react";
import styles from "./Pagination.module.css";

export function Pagination(props) {
  // this.state = {
  //   query: "",
  //   results: {},
  //   error: "",
  //   message: "",
  //   loading: false,
  //   totalResults: 0,
  //   totalPages: 0,
  //   currentPageNo: 0,
  // };

  // const [query, setQuery] = useState("");
  // const [results, setResults] = useState([]);
  // const [error, setError] = useState("");
  // const [message, setMessage] = useState("");
  // const [loading, setLoading] = useState(false);
  // const [totalResults, setTotalResults] = useState(0);
  // const [currentPage, setCurrentPage] = useState(0);

  return (
    <div className={styles["pagination"]}>
      <nav className="pagination" role="navigation" aria-label="pagination">
        <div className="pagination-previous">Previous</div>
        <div className={`pagination-next ${styles["pagination-next"]}`}>
          Next page
        </div>
        <ul className="pagination-list">
          <li>
            <a
              className="pagination-link is-current"
              aria-label="Page 1"
              aria-current="page"
              href="/#"
            >
              1
            </a>
          </li>
          <li>
            <a className="pagination-link" aria-label="Goto page 2" href="/#">
              2
            </a>
          </li>
          <li>
            <a className="pagination-link" aria-label="Goto page 3" href="/#">
              3
            </a>
          </li>
        </ul>
      </nav>
    </div>
  );
}
